import React from "react";
import { Link } from "react-router-dom";
import "./Order.css";
import { Card, CardBody, CardTitle, CardSubtitle, CardText } from "reactstrap";

const Final = () => {
  const handleButtonClick = () => {
    // Butona tıklandığında yapılacak işlemleri buraya ekleyebilirsiniz
    console.log("Butona tıklandı!");
    // Örnek olarak bir mesaj gösterimi
    alert("Sipariş alındı!");
  };

  return (
    <div className="EndTop">
      <div>
        <button onClick={handleButtonClick}>Butona Tıkla</button>
      </div>
      <div className="enduse">
        <Link to="/">
          <h1>Teknolojik Yemekler</h1>
        </Link>
        <h3>Lezzetin Yolda </h3>
      </div>

      <div className="end">
        <h1>Siparişiniz Alındı! </h1>
        <h3>Position Absolute Acılı Pizza </h3>
        <ul>
          <li> Boyut: L </li>
          <li> Hamur: Süper İnce </li>
          <li>
            Pepperoni, <br></br>Sosis, Salam, Mısır <br></br> Ananas{" "}
          </li>
        </ul>
      </div>

      <div className="hesap">
        <Card
          style={{
            width: "18rem",
          }}
        >
          <div className="bodycard">
            <CardBody>
              <CardTitle>Sipariş Toplamı</CardTitle>
              <CardSubtitle></CardSubtitle>
              <CardText>
                Seçimler: 25TL
                <br></br>
                Toplam: 110.50tl
              </CardText>
            </CardBody>
          </div>
        </Card>
      </div>
    </div>
  );
};

export default Final;
